import React from "react";
import logo from "../../images/austria.png";
import "./Nav.css";
import { FaAlignRight } from "react-icons/fa";

class Nav {
  state = {
    toggle: false,
  };
  Toggle = () => {
    this.setState({ toggle: !this.state.toggle });
  };
  render() {
    return (
      <div className="Nav">
        <nav>
          <img src={logo} className="logo" alt="logo" />
          <ul className="App-title">
            <li>
              <a href="">About Us</a>
            </li>
            <li>
              <a href="">Our Program</a>
            </li>
            <li>
              <a href="">Bootcamp</a>
            </li>
            <li>
              <a href="">Events</a>
            </li>
            <li>
              <a href="">Sign Up</a>
            </li>
            <li>
              <a href="">Login</a>
            </li>
            <button onClick={this.Toggle}>
              <FaAlignRight />
            </button>
          </ul>
        </nav>
      </div>
    );
  }
}

export default Nav;
